import { NavLink } from 'react-router-dom';
import React from 'react';
import logo from '../images/fcp.png'

const Index = () => (
    <div className="col-12 col-lg-5">
    <div style={{ margin: '0 auto' }}>
      <img style={{ maxWidth: 300, margin: '0 auto' }} alt="logo" src={logo}/>
    </div>
    <div style={{ textAlign: 'center' }}>
      <p> Managing Motivation in Business </p>
      <p> The Fargus Consulting Partnership (FCP) is a family business. We specialise in measuring and improving motivation in business. Our approach is detailed in our Executive Briefing entitled Measuring and Improving Employee Motivation available here. </p>
    </div>
    </div>
);

export default Index;
